import actions from './actions';

const { RESET_PASSWORD } = actions;

const initState = {
  error: null,
  errorMessage: null,
};
const ResetPasswordReducer = (state = initState, action) => {
  const { type, data } = action;
  console.log(type, data);
  switch (type) {
    case RESET_PASSWORD:
      return {
        ...state,
        error: data.responseCode,
        errorMessage: data.responseMessage,
      };
    default:
      return state;
  }
};
export default ResetPasswordReducer;
